import React,{createContext} from 'react'

// IMAGES
import doodldeImg from "../assets/doodle.png";
import artImg from "../assets/nel-art.png";
import workstation1 from "../assets/workstation.jpg";
import workstation2 from "../assets/wwrkst2.jpg";
export const EssentialsContext =createContext()
function Essentials(props) {
    let text ="ESSENTIALS WORKS"
  return (
    <EssentialsContext.Provider
      value={{
        workstation2,
        doodldeImg,
        artImg,
        workstation1,
      }}>
      {props.children}
    </EssentialsContext.Provider>
  );
}

export default Essentials
